import React, { useState, useRef } from 'react';
import UPNG from 'upng-js';
import ImageUploadBox from './ImageUploadBox';
import ImageDisplayBox from './ImageDisplayBox';
import './DecodeForm.css';
import { decodeWithSSS } from '../encodeWithSSS';

const DecodeForm = () => {
  const [inputImages, setInputImages] = useState([null, null, null]);
  const [decodedImage, setDecodedImage] = useState(null);
  const sharesRef = useRef([]);

  const handleImageUpload = (file, index) => {
    if (!file) {
      console.error("No file selected!");
      return;
    }

    const reader = new FileReader();

    reader.onload = (e) => {
      if (!e.target?.result) return;
      const arrayBuffer = e.target.result;
      const png = UPNG.decode(arrayBuffer);
      const rawPixels = new Uint8Array(UPNG.toRGBA8(png)[0]);

      // Extract image number from first pixel's alpha channel
      const imageNumber = rawPixels[3] & 0b00000111;
      console.log(`Image ${index+1} number:`, imageNumber);

      // Extract the hidden 2-bit chunks from each channel
      const extractedBits = [];
      for (let i = 0; i < rawPixels.length; i += 4) {
        // Skip alpha channel (i+3)
        extractedBits.push(rawPixels[i] & 0b00000011);   // R
        extractedBits.push(rawPixels[i+1] & 0b00000011); // G
        extractedBits.push(rawPixels[i+2] & 0b00000011); // B
      }

      // Store the share data with its image number
      sharesRef.current[index] = {
        imageNumber,
        extractedBits
      };

      // Update the input image preview
      const newInputImages = [...inputImages];
      newInputImages[index] = URL.createObjectURL(file);
      setInputImages(newInputImages);
    };

    reader.onerror = (error) => {
      console.error('File reading error:', error);
    };
    reader.readAsArrayBuffer(file);
  };

  const handleDecode = () => {
  // Check if we have all 3 required images
  if (sharesRef.current.filter(Boolean).length < 3) {
    alert('Please upload all 3 required images for decoding');
    return;
  }

  // Sort shares by their image number (1-6)
  const sortedShares = [...sharesRef.current].sort((a, b) => a.imageNumber - b.imageNumber);

  // Reconstruct the original bytes from the 2-bit chunks
  const reconstructedPixels = [];
  const bitChunks = sortedShares.flatMap(share => share.extractedBits);

  // Combine every 4 chunks (8 bits) into a byte
  for (let i = 0; i < bitChunks.length; i += 4) {
    if (i + 3 >= bitChunks.length) break;

    const byte = (bitChunks[i] << 6) | 
                 (bitChunks[i+1] << 4) | 
                 (bitChunks[i+2] << 2) | 
                 bitChunks[i+3];
    reconstructedPixels.push(byte);
  }

  // Calculate proper dimensions (assuming square image)
  const totalPixels = reconstructedPixels.length / 4; // RGBA = 4 bytes per pixel
  const sideLength = Math.floor(Math.sqrt(totalPixels));
  const properLength = sideLength * sideLength * 4;

  // Create properly sized RGBA buffer
  const rgba = new Uint8Array(properLength);

  // Copy only the valid pixels (truncate any extra bytes)
  const copyLength = Math.min(properLength, reconstructedPixels.length);
  for (let i = 0; i < copyLength; i++) {
    rgba[i] = reconstructedPixels[i];
  }

  // Fill remaining pixels with transparent black if needed
  for (let i = copyLength; i < properLength; i++) {
    rgba[i] = i % 4 === 3 ? 255 : 0; // Alpha=255, others=0
  }

  // Create PNG from the reconstructed data
  const pngData = UPNG.encode([rgba.buffer], sideLength, sideLength, 0);
  const url = URL.createObjectURL(new Blob([pngData], { type: "image/png" }));
  setDecodedImage(url);
};
  return (
    <div className="decode-form">
      <div className="decode-section section-inputs">
        <h3>Upload 3 Shares for Decoding</h3>
        <div className="decode-input-grid">
          {[0, 1, 2].map((index) => (
            <ImageUploadBox
              key={index}
              label={`Share ${index + 1}`}
              onImageUpload={(file) => handleImageUpload(file, index)}
            />
          ))}
        </div>
        <button onClick={handleDecode} className="decode-action-button">
          Decode Image
        </button>
      </div>

      <div className="decode-section section-output">
        <h3>Reconstructed Image</h3>
        <ImageDisplayBox
          imageSrc={decodedImage || 'https://via.placeholder.com/250/DDDDDD/000000?Text=DecodedImageHere'}
          altText="Decoded Result"
          className="decoded-image-display"
        />
      </div>
    </div>
  );
};

export default DecodeForm;
